style.css:
@-moz-document domain("roblox.com") {
/*/ Pulsing Animation /*/
  @keyframes header-white {
    0% {
      border-color: grey;
    } 60% {
      border-color: grey; 
    } 80% {
      border-color: white;
    }
  }
  
  /*/ Animation Settings /*/
	.rbx-header {
    animation: header-white 5s infinite;
  }
}
